        async function getPerfil () {
            const id = localStorage.getItem('id')
            const response = await axios.post('http://localhost:3333/perfil', {
                "id": id
            })
            // setData([...data, response])
            console.log(response.data)
            setData(response)
        }
        getPerfil()
    },[])
